name: rsh

model_type: segmented_regression

segmentation_col: hedonic_sector_id

fit_filters:
- residential_units > 0
- sqft_per_unit > 0
- year_built > 1700
- stories > 0
- 1e1 < sqft_price_res < 1e6
- 81 <= building_type_id <= 84

predict_filters:
- residential_units > 0
- 81 <= building_type_id <= 84

min_segment_size: 10

default_config:
    model_expression: np.log1p(sqft_price_res) ~ I(year_built < 1940) + year_built
        + stories + np.log1p(sqft_per_unit) + np.log1p(popden) + crime_ucr_rate
    ytransform: np.exp

